const About = () => {
    return ( 
        <div className="static-page">
            <h2>About Health Track</h2>
            <p>
                Health Track is your personal wellness and fitness tracking companion. We aim to provide a simple, effective platform for logging your daily activities, meals, and exercise routines, helping you stay accountable and visualize your progress towards your health goals.
            </p>
            <p>
                This application was developed as the Phase 1 project for CSCI426: Advanced Web Programming. It demonstrates proficiency in ReactJS, state management using Context, and responsive front-end design.
            </p>
            <p>
                Future phases will integrate a robust backend (Node.js/Express) and a database (MongoDB/Firestore) to enable persistent user accounts and data storage.
            </p>
        </div>
     );
}
 
export default About;
